art_time":"2022-02-23T10:38:51.609109","status":"completed"},"tags":[]},"source":["* The graph shows a positive linear correlation between the total steps taken and calories burned. Since there is a linear correlation, will use Pearson coefficient correlation (Pearson's product moment correlation coefficient) to determine how strong these two variables are related."]},{"cell_type":"markdown","id":"5c6aab03","metadata":{"papermill":{"duration":0.39664,"end_time":"2022-02-23T10:38:52.804413","exception":false,"start_time":"2022-02-23T10:38:52.407773","status":"completed"},"tags":[]},"source":["* ####  **Correlation test between TotalSteps taken and Calories burned:**\n"," **cor.test()-** test for correlation between paired samples. It returns both the correlation coefficient and the significance level(or p-value) of the correlation."]},{"cell_type":"code","execution_count":12,"id":"3e5b7395","metadata":{"execution":{"iopub.execute_input":"2022-02-23T10:38:53.60105Z","iopub.status.busy":"2022-02-23T10:38:53.599406Z","iopub.status.idle":"2022-02-23T10:38:53.619516Z","shell.execute_reply":"2022-02-23T10:38:53.618167Z"},"papermill":{"duration":0.417615,"end_time":"2022-02-23T10:38:53.619697","exception":false,"start_time":"2022-02-23T10:38:53.202082","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$TotalSteps and activity$Calories\n","t = 22.472, df = 938, p-value < 2.2e-16\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.5483688 0.6316184\n","sample estimates:\n","      cor \n","0.5915681 \n"]},"metadata":{},"output_type":"display_data"}],"source":["cor.test(activity$TotalSteps,activity$Calories, method=\"pearson\")"]},{"cell_type":"markdown","id":"1f225106","metadata":{"papermill":{"duration":0.395441,"end_time":"2022-02-23T10:38:54.412323","exception":false,"start_time":"2022-02-23T10:38:54.016882","status":"completed"},"tags":[]},"source":["* From the above result, we can interpret that the p-value <2.2e-16, which is less than significance level(0.05). So we can conclude that Totalsteps and Calories are statically significant with moderately positive correlation(correlation coefficient=0.59).\n","\n","* Let's do futher analysis on how different active minutes and distance have impact on this."]},{"cell_type":"markdown","id":"ad3d9501","metadata":{"papermill":{"duration":0.40676,"end_time":"2022-02-23T10:38:55.215557","exception":false,"start_time":"2022-02-23T10:38:54.808797","status":"completed"},"tags":[]},"source":["#### **V.2.b. Calories burned by active minutes:** <a id=\"ca\"></a>\n","Comparing by Calories burned at different Activity Minutes"]},{"cell_type":"code","execution_count":13,"id":"b79e238e","metadata":{"execution":{"iopub.execute_input":"2022-02-23T10:38:56.067625Z","iopub.status.busy":"2022-02-23T10:38:56.06548Z","iopub.status.idle":"2022-02-23T10:38:56.12441Z","shell.execute_reply":"2022-02-23T10:38:56.122551Z"},"papermill":{"duration":0.467527,"end_time":"2022-02-23T10:38:56.124585","exception":false,"start_time":"2022-02-23T10:38:55.657058","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Adding missing grouping variables: `Id`, `date`\n","\n"]},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A grouped_df: 4 × 6</caption>\n","<thead>\n","\t<tr><th scope=col>Id</th><th scope=col>date</th><th scope=col>TotalSteps</th><th scope=col>Calories</th><th scope=col>Category</th><th scope=col>Minutes</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>1503960366</td><td>04/12/16</td><td>13162</td><td>1985</td><td>SedentaryMinutes    </td><td>728</td></tr>\n","\t<tr><td>1503960366</td><td>04/12/16</td><td>13162</td><td>1985</td><