cell_type":"markdown","id":"0035a703","metadata":{"papermill":{"duration":0.413328,"end_time":"2022-02-23T10:39:00.494585","exception":false,"start_time":"2022-02-23T10:39:00.081257","status":"completed"},"tags":[]},"source":["* #### **Correlation test between Active Minutes and Calories burned:**"]},{"cell_type":"code","execution_count":15,"id":"fcc81241","metadata":{"execution":{"iopub.execute_input":"2022-02-23T10:39:01.332454Z","iopub.status.busy":"2022-02-23T10:39:01.330946Z","iopub.status.idle":"2022-02-23T10:39:01.363915Z","shell.execute_reply":"2022-02-23T10:39:01.362472Z"},"papermill":{"duration":0.453342,"end_time":"2022-02-23T10:39:01.36405","exception":false,"start_time":"2022-02-23T10:39:00.910708","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$SedentaryMinutes\n","t = -3.2951, df = 938, p-value = 0.001021\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," -0.16975380 -0.04332754\n","sample estimates:\n","      cor \n","-0.106973 \n"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$LightlyActiveMinutes\n","t = 9.1661, df = 938, p-value < 2.2e-16\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.2269361 0.3443464\n","sample estimates:\n","      cor \n","0.2867175 \n"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$FairlyActiveMinutes\n","t = 9.5479, df = 938, p-value < 2.2e-16\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.238215 0.354813\n","sample estimates:\n","      cor \n","0.2976235 \n"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$VeryActiveMinutes\n","t = 23.939, df = 938, p-value < 2.2e-16\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.5745197 0.6540260\n","sample estimates:\n","      cor \n","0.6158383 \n"]},"metadata":{},"output_type":"display_data"}],"source":["cor.test(activity$Calories,activity$SedentaryMinutes, method=\"pearson\")\n","cor.test(activity$Calories,activity$LightlyActiveMinutes, method=\"pearson\")\n","cor.test(activity$Calories,activity$FairlyActiveMinutes, method=\"pearson\")\n","cor.test(activity$Calories,activity$VeryActiveMinutes, method=\"pearson\")"]},{"cell_type":"markdown","id":"75357c16","metadata":{"papermill":{"duration":0.421452,"end_time":"2022-02-23T10:39:02.205868","exception":false,"start_time":"2022-02-23T10:39:01.784416","status":"completed"},"tags":[]},"source":["**From the above result, we can interpret:**\n","* Very Active Minutes: The p-value <2.2e-16, which is less than significance level(0.05). VeryActive Minutes and Calories are statically significant with moderately positive correlation(correlation coefficient=0.61). \n","\n","* Fairly Active Minutes: The p-value <2.2e-16, which is less than significance level. Fairly Active Minutes and Calories are statically significant with low positive correlation(0.29).\n","\n","* Lightly Active Minutes: The p-value <2.2e-16, which is less than significance level. LightlyActiveMinutes and Calories are statically significant with positive correlation(0.28).\n","\n","* SedentaryMinutes: The p-value = 0.001021, which is less than significance level. SedentaryMinutes and Calories are statically significant with negative correlation(-0.106)."]},{"cell_type":"markdown","id":"f8bb31c2","metadata":{"papermill":{"duration":0.422744,"end_time":"2022-02-23T10:39:03.049284","exception":false,"start_time":"2022-02-23T10:39:02.62654","status":"completed"},"tags":[]},"sou