urce":["#visualize\n","plotc <-ggplot(activity2,aes(x=Distance,y=Calories,color=Category))+\n","  geom_jitter(stat=\"identity\")+\n","  scale_color_manual(values=c(\"chartreuse3\",\"darksalmon\",\"darkslategray3\",\"coral3\"))+\n","  geom_smooth(formula=y~x,color=\"deepskyblue4\",method=\"lm\",se=F)+\n","  facet_wrap(~ Category,scales=\"free_x\")+\n","  ylim(0,5000)+\n","  labs(title= \"Comparing Calories burned by Distance\",x= \"Distance\", y= \"Calories Burned\")+\n","  theme(legend.title = element_blank())+\n","  theme_minimal()\n","options(repr.plot.width = 12, repr.plot.height = 10, repr.plot.res = 150)\n","\n","suppressWarnings(print(plotc))"]},{"cell_type":"markdown","id":"a7af8319","metadata":{"papermill":{"duration":0.437058,"end_time":"2022-02-23T10:39:06.654395","exception":false,"start_time":"2022-02-23T10:39:06.217337","status":"completed"},"tags":[]},"source":["* The graph shows a positive linear correlation between the VeryActive Distance/ModeratelyActive Distance/LightlyActive Distance and calories burned. But there is no correlation between Sedentary Active Distance and calories burned. Will use Pearson coefficient correlation to determine how strong these variables are related."]},{"cell_type":"markdown","id":"7a464f43","metadata":{"papermill":{"duration":0.461303,"end_time":"2022-02-23T10:39:07.55599","exception":false,"start_time":"2022-02-23T10:39:07.094687","status":"completed"},"tags":[]},"source":["* #### **Correlation test between Active Distance and Calories burned:**"]},{"cell_type":"code","execution_count":18,"id":"e7384954","metadata":{"execution":{"iopub.execute_input":"2022-02-23T10:39:08.437576Z","iopub.status.busy":"2022-02-23T10:39:08.435483Z","iopub.status.idle":"2022-02-23T10:39:08.474531Z","shell.execute_reply":"2022-02-23T10:39:08.472782Z"},"papermill":{"duration":0.47946,"end_time":"2022-02-23T10:39:08.474686","exception":false,"start_time":"2022-02-23T10:39:07.995226","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$SedentaryActiveDistance\n","t = 1.3382, df = 938, p-value = 0.1812\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," -0.02034679  0.10729427\n","sample estimates:\n","       cor \n","0.04365187 \n"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$LightActiveDistance\n","t = 16.171, df = 938, p-value < 2.2e-16\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.4153762 0.5154690\n","sample estimates:\n","      cor \n","0.4669168 \n"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$ModeratelyActiveDistance\n","t = 6.8013, df = 938, p-value = 1.844e-11\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.1549966 0.2768935\n","sample estimates:\n","      cor \n","0.2167899 \n"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$VeryActiveDistance\n","t = 17.306, df = 938, p-value < 2.2e-16\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.4419180 0.5389469\n","sample estimates:\n","      cor \n","0.4919586 \n"]},"metadata":{},"output_type":"display_data"}],"source":["cor.test(activity$Calories,activity$SedentaryActiveDistance, method=\"pearson\")\n","cor.test(activity$Calories,activity$LightActiveDistance, method=\"pearson\")\n","cor.test(activity$Calories,activity$ModeratelyActiveDistance, method=\"pearson\")\n","cor.test(activity$Calories,activity$VeryActiveDistance, method=\"pearson\")"]},{"cell_type":"markdown","id":"da220c42","metadata":{"papermill":{"duration":0.455772,"end_time":"2022-02-23T10:39:09.379076","exception":false,"start_time":"2022-02-23T10:39:08.923304","status":"completed"},"tags":[]},"source":["**From the above result, we can interpret:**\n","* Very Active Distance: The p-value <2.2e-16, which is less than significance level(0.05). VeryActive Distance and Calories are statically significant with low positive correlation(correlation coefficient=0.49). \n","\n","* Moderately Active Distance: The p-value = 1.844e-11, which is less than significance level. Moderately Active Distance and Calories burned have marginally low positive correlation(correlation coefficient=0.21). This may be due to, too many data points between (0-2 miles) and few outliers.\n","\n","* Lightly Active Distance: The p-value <2.2e-1, which is less than significance level(0.05). LightlyActiveMinutes and Calories are statically significant with positive correlation(0.46).\n","\n","* Sedentary Active Distance: The p-value = 0.1812, is higher and correlation coeficient is almost zero(0.043). Marginally low relationship between Sedentary Active Distance and Calories burned. This may be due to too many data points to zero and few outliers."]},{"cell_type":"markdown","id":"fde8d8c3","metadata":{"papermill":{"duration":0.447859,"end_time":"2022-02-23T10:39:10.270019","exception":false,"start_time":"2022-02-23T10:39:09.82216","status":"completed"},"tags":[]},"source":["#### **V.2.d. Intensity by Week Day:** <a id=\"intw\"></a>\n","To analyze users workout intensity level throughout the week"]},{"cell_type":"code","execution_count":19,"id":"265f30fc","metadata":{"execution":{"iopub.execute_input":"2022-02-23T10:39:11.166877Z","iopub.status.busy":"2022-02-23T10:39:11.165439Z","iopub.status.idle":"2022-02-23T10:39:11.210543Z","shell.execute_reply":"2022-02-23T10:39:11.209086Z"},"papermill":{"duration":0.495506,"end_time":"2022-02-23T10:39:11.210691","exception":false,"start_time":"2022-02-23T10:39:10.715185","stat