plete.obs\")\n","round(corr1,2)"]},{"cell_type":"markdown","id":"d3b12d7e","metadata":{"papermill":{"duration":0.475725,"end_time":"2022-02-23T10:39:25.818082","exception":false,"start_time":"2022-02-23T10:39:25.342357","status":"completed"},"tags":[]},"source":["* There is a strong positive correlation between steps, intensity and distance , however calories burned is moderately correlated."]},{"cell_type":"markdown","id":"ea3f2fe4","metadata":{"papermill":{"duration":0.534986,"end_time":"2022-02-23T10:39:26.832138","exception":false,"start_time":"2022-02-23T10:39:26.297152","status":"completed"},"tags":[]},"source":["#### **V.2.g. Energy Expenditure: METs Vs. Steps Taken** <a id=\"eems\"></a>\n","A [MET](https://www.hsph.harvard.edu/nutritionsource/staying-active/)(metabolic equivalent of task) is a ratio of your working metabolic rate relative to your resting metabolic rate. Metabolic rate is the rate of energy expended per unit of time. It’s one way to describe the intensity of an exercise or activity.\n","\n","* Resting—Uses 1.5 or fewer METs. Examples are sitting, reclining, or lying down.\n","* Light intensity—Uses from 1.6-3.0 METs. Examples are walking at a leisurely pace or standing in line at the store.\n","* Moderate intensity—Uses from 3.0-6.0 METs. Examples are walking briskly, vacuuming, or raking leaves.\n","* Vigorous intensity—Uses from 6.0+ METs.\n","\n","Fitbit API returns MET values without a decimal point. So divide METs by 10 before analysis. [More Info](http://community.fitbit.com/t5/Web-API-Development/Definition-of-Mets-in-Charge-HR/td-p/1240824)"]},{"cell_type":"code","execution_count":26,"id":"b3f689de","metadata":{"execution":{"iopub.execute_input":"2022-02-23T10:39:27.801847Z","iopub.status.busy":"2022-02-23T10:39:27.801167Z","iopub.status.idle":"2022-02-23T10:40:57.03549Z","shell.execute_reply":"2022-02-23T10:40:57.036024Z"},"papermill":{"duration":89.717422,"end_time":"2022-02-23T10:40:57.036209","exception":false,"start_time":"2022-0