oursAsleep | 6.99 |\n","| Saturday | 91.25 | mean_TotalHoursAsleep | 6.99 |\n","\n"],"text/plain":["  day      effeciency s1                    m1  \n","1 Friday   91.11      mean_TotalHoursAsleep 6.76\n","2 Monday   91.73      mean_TotalHoursAsleep 6.99\n","3 Saturday 91.25      mean_TotalHoursAsleep 6.99"]},"metadata":{},"output_type":"display_data"}],"source":["# Sleep Analysis\n","#Convert sleep in Hours and caluclate mean and efficiency\n","\n","sleep2<-sleep%>%\n","  mutate(TotalHoursAsleep= round(TotalMinutesAsleep/60,2), TotalHoursInBed= round(TotalTimeInBed/60,2))\n","#head(sleep2,3)\n","\n","sleep_df2 <- sleep2 %>%\n","  group_by(day) %>%\n","  summarise(mean_TotalHoursAsleep= round(mean(TotalHoursAsleep),2), mean_TotalHoursinBed= round(mean(TotalHoursInBed),2),effeciency=round((mean_TotalHoursAsleep/mean_TotalHoursinBed)*100,2),.groups='drop')%>%\n","  mutate(day=factor(day,levels=c(\"Monday\",\"Tuesday\",\"Wednesday\",\"Thursday\",\"Friday\",\"Saturday\",\"Sunday\")))\n","#head(sleep_df2,3)  \n","\n","sleep_df22 <- gather(sleep_df2,s1,m1,mean_TotalHoursAsleep:mean_TotalHoursinBed)\n","head(sleep_df22,3)"]},{"cell_type":"code","execution_count":33,"id":"cc0c4f62","metadata":{"execution":{"iopub.execute_input":"2022-02-23T10:49:23.962617Z","iopub.status.busy":"2022-02-23T10:49:23.961606Z","iopub.status.idle":"2022-02-23T10:49:24.376926Z","shell.execute_reply":"2022-02-23T10:49:24.376313Z"},"papermill":{"duration":0.950288,"end_time":"2022-02-23T10:49:24.377073","exception":false,"start_time":"2022-02-23T10:49:23.426785","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABwgAAAXcCAIAAAC5wU3BAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ3wVVcLA4bnJDT2ACIJSFERUigqKXbGiKNbXVbFid1kVK6igoCKIDXQRdVdF\n14IFe3cBC8pasbIiIjaUxdBrSH0/gMlNCO2ScEnO8/z8kJnMvTlzyNUff8/MxCbPyIoAAAAA\nAEKSluoBAAAAAABsbMIoAAAAABAcYRQAAAAACI4wCgAAAAAERxgFAAAAAIIjjAIAAAAAwRFG\nAQAAAIDgCKMAAAAAQHCEUQAAAAAgOMIoAAAAABAcYRQAAAAACI4wCgAAAAAERxgFAAAAAIIj\njAIAAAAA